import { useEffect } from "react";
import mc from "./logs-menu.module.scss";
import { useDispatch, useSelector } from "react-redux";

const LogsMenu = () => {
  const dispatch = useDispatch();
  //   logsReducer

  const { logs } = useSelector((store) => {
    return {
      logs: store.logsReducer.logs,
    };
  });

  //   console.log(logs);

  useEffect(() => {
    dispatch({
      type: "UPDATE_LOGS",
      payload: { newlog: "test2" },
    });
  }, []);

  // useEffect(() => {
  //   dispatch({
  //     type: "RESET_LOGS",
  //     payload: { newlog: <li>test</li> },
  //   });
  // }, []);

  return (
    <ul className={mc.container}>
      {logs.map((el, i) => (
        <li key={i} className={mc.log}>
          <span>{el}</span>
        </li>
      ))}
    </ul>
  );
};

export default LogsMenu;
